`
    );
    const data = await api.json();
    console.log(data);
  };*/

 return (
   <div className="App">
     <header className="App-header">
       <HideAppBar />
       {JSON.stringify({ weather })}
     </header>
     {weather.datas.name}
     {weather.datas}
   </div>
 );
}

export default App;

